import React from 'react';
import styled from 'styled-components';

let coordenates = [
 [0, 1] , [0, 2] , [2, 3], [4, 3] , [7, 3] , [8, 5] , [8, 7] , [ 8, 8]
]

const Grid = () => {
  return (
    <Wrapper>
      {
        coordenates.map((coord)=> (
          <>
         <BlankItem> {coord[0]} </BlankItem>
          <BlankItem> {coord[1]} </BlankItem>
          </>
        ))
      }

    </Wrapper>
  );
};
const Wrapper = styled.div`
  width:400px;
  height:400px;
  display:flex;
  flex-wrap:wrap;
  border:1px solid blue;
`;

const BlankItem = styled.div`
  width: 40px;
  height: 40px;
  background: blue;
`
const SelectedItem = styled.div`
  width: 40px;
  height: 40px;
  background: red;
`
export default Grid;
